import React, {Component} from 'react';
import './style/dashboard.css';
//import LoginPage from './loginpage'
export default class Dashboard extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <div className="textbox">
            <h1>
                Welcome, Puttipong
            {this.props.username}
            </h1>
            </div>
            
        )
    }
}
